class Solution {
  static const int mod = 1000000007;

  int digitSum(int n) {
    int sum = 0;
    while (n > 0) {
      sum += n % 10;
      n = n ~/ 10;
    }
    return sum;
  }

  int countGoodIntegers(int start, int end, int minSum, int maxSum) {
    int count = 0;
    for (int i = start; i <= end; i++) {
      int sum = digitSum(i);
      if (sum >= minSum && sum <= maxSum) {
        count = (count + 1) % mod;
      }
    }
    return count;
  }

  int count(String num1, String num2, int minSum, int maxSum) {
    int start = int.parse(num1);
    int end = int.parse(num2);
    return countGoodIntegers(start, end, minSum, maxSum);
  }
}
